import "./ExpenseForm.css";

const NewAdd = (props) => {
  const submission = (event) => {
    event.preventDefault();
    props.func();
  };

  return (
    <form onSubmit={submission}>
      <div className="new-expense__actions">
        <button type="submit">Add New Expense</button>
      </div>
    </form>
  );
};
export default NewAdd;
